INSERT INTO `mdl_course_sections` VALUES (13,4,0,NULL,'',1,'7',1,NULL,0),(14,4,1,'','<h3>Como tudo começou</h3><p>O Moodle é um projeto que começou a ser desenvolvido por Martim Dougiamas, que ainda faz parte do projeto. Nos anos de 1990, ainda como webmaster na Curtin University of Technology e administrador de sistemas de instalação deles, começou a sentir uma grande frustração com os cursos oferecidos pela internet. Como, na época, ainda tudo o que era disponível nessa área era pago, Dougiamas queria que as pessoas tivessem uma alternativa que fosse gratuita para que pudessem disponibilizar o seu conteúdo, as suas capacidades e poderem trocar informações de forma sensata e que agregasse valor a quem participasse da aula.</p>',1,'9',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1571961274),(15,4,2,'','<h3>O desenvolvimento da plataforma e as ideias</h3><p>Toda essa insatisfação fez com que Dougiamas se especializasse na área de educação, fazendo mestrado e doutorado na área, sempre é claro combinando a sua carreira na área de ciência da computação com o que tinha acabado de elaborar, o conceito de conhecimento sobre a natureza da aprendizagem e da colaboração.</p>',1,'',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1571961292),(16,4,3,'','<h3>A ideia inicial da Plataforma Moodle</h3><p>A sua grande influência veio da epistemologia do construcionismo social, que tem como principal base a aprendizagem como uma atividade social, sempre com foco na aprendizagem que ocorre enquanto há a construção ativa de artefatos, como textos, perguntas etc.</p>',1,'',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1571961306),(17,4,4,'','<h3>Aspectos funcionais da plataformas</h3><p>Para Dougiamas, era essencial que a plataforma fosse fácil de usar, de forma bem intuitiva para que até aqueles que não estão acostumados a usar o computador pudessem ter acesso. Na plataforma, é possível participar de chats com os alunos e professores, disponibilizar arquivos de material do curso para downloads e até mesmo fazer exercícios.</p>',1,'',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1571961331),(18,4,5,'','<h3>Desenvolvimento da Plataforma Moodle</h3><p>Nada que é desenvolvido fica pronto de uma hora para outra. Sempre é necessário muita pesquisa e adaptações. Com o Moodle não foi diferente, uma vez que foram desenvolvidos vários protótipos até que se chegasse à plataforma final. Isso, porém, não quer dizer que a plataforma não passa mais por mudanças, uma vez que sempre há algo o que aperfeiçoar, para oferecer um melhor serviço a cada dia. Os primeiros protótipos foram desenvolvidos, mas acabaram sendo deixados de lado. Porém, em 20 de agosto de 2002, Dougiamas lançou a versão 1.0 da Plataforma Moodle, o que deixou muitas pessoas surpresas.</p>',1,'',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1571961351),(19,4,6,'','<p><h3>A versão 1.0 e suas outras versões</h3><p>Essa primeira versão lançada era voltada para pequenas turmas, com nível universitário, que sempre eram sujeitas a pesquisas de estudo de casos. Pois, dessa forma, era possível analisar a natureza de colaboração e da reflexão que aconteciam. A partir desses estudos de casos foram desenvolvidas muitas outras versões, sempre acrescentando novos recursos, com uma melhor escalabilidade, mostrando o seu melhor desempenho.</p><br></p>',1,'',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1571961374),(20,4,7,'','<p><h3>Plataforma Moodle hoje</h3><p>A plataforma cresceu muito, espalhando-se por todo mundo e para diferentes níveis de aprendizado, já que atualmente existem cursos abertos no Moodle, escolas de ensino médio e fundamental que utilizam a plataforma. Não deixe de comentar abaixo sobre como é sua relação com Moodle. Até a próxima!</p><br></p>',1,'10',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1571961388),(22,4,8,'','<p>Tutorial Moodle Completo passo-a-passo</p><p>&nbsp;<a href=\"https://www.youtube.com/playlist?list=PLd-QtXnha0KcZoD8CqIbLg3I11Vptvfnk\">https://www.youtube.com/playlist?list=PLd-QtXnha0KcZoD8CqIbLg3I11Vptvfnk</a><br></p>',1,'',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1571961567),(23,4,9,'','<p>Outra play list de Moodle</p><p><a href=\"https://www.youtube.com/playlist?list=PLd-QtXnha0KdkQQn9JMtS_LGEq413fTwE\">https://www.youtube.com/playlist?list=PLd-QtXnha0KdkQQn9JMtS_LGEq413fTwE</a><br></p>',1,'',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1571961601),(27,1,1,NULL,'',1,'',1,NULL,1571963097),(29,7,0,'','<p><b id=\"docs-internal-guid-aa61ff5b-7fff-e221-b00e-77c73de6bb68\"><h3 dir=\"ltr\">SERVIÇOS</h3><p dir=\"ltr\">Abaixo imagem com os serviços do SafeQ</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\"><img src=\"https://lh4.googleusercontent.com/RF_5dgV-jViOLFrJlhCJqAaEGhFcs_drZkhkIvQej7K08xqFzcHLNarOqVHufW-WnWVhsFzkTdRUyu1Jyz-zSvvzq4brhW-PqnLiNpXoSY-QzTSBfSAxvo_VN_4SRU5H6FA04YmlYmmxCdRgug\" width=\"499\" height=\"260\"></p></b><br><br></p>',1,'11',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1573761071),(30,7,1,'','<p><b id=\"docs-internal-guid-d6c90fce-7fff-5814-04b8-8782fd2c8297\"><h3 dir=\"ltr\">CONFIGURAÇÕES DE CENTRO DE CUSTO</h3><p dir=\"ltr\">Para clientes que possuem conexão com o AD (LDAP) e não possuem as informações de Centro de Custo corretas nesta conexão, podemos editar as informações de Centro de Custo localmente no safeQ.</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">Uma vez que decidirmos fazer esta configuração de Centro de Custo no safeQ, temos que desabilitar na sincronização com o AD, a atualização das informações de Centro de Custo, caso contrário, essas configurações feitas localmente no safeQ serão sobrescritas pelas informações da conexão com o AD.</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\"><a href=\"https://bdm.bitrix24.com.br/docs/pub/0b07c78ae4a90fc4bedf4e29b1fb9be0/showFile/?&amp;token=vqnjd2j6makf\">AQUI</a> como desabilitar na sincronização com o AD, a atualização do Centro de Custos nos usuários.</p><p dir=\"ltr\"><a href=\"https://bdm.bitrix24.com.br/disk/showFile/232/?&amp;ncc=1&amp;ts=1534161739&amp;filename=safeq6+cc2.jpeg\">AQUI</a> como parar de importar centros de custos no safeQ</p></b><br><br></p>',1,'',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1573761086),(31,7,2,'','<p><b id=\"docs-internal-guid-75386c60-7fff-a04c-1b03-a2f062137d65\"><h3 dir=\"ltr\">CONFIGURAÇÕES DE COTA DE IMPRESSÃO</h3><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">Para configurar as Cotas de Impressão, devemos nos atentar a algumas configurações.</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">Primeiro o Payment System deve estar instalado</p><p dir=\"ltr\">Segundo a integração com o Payment System deve estar Habilitada</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\"><img src=\"https://lh6.googleusercontent.com/PpArjPZu60DN9XtJIMgauG29NPQPRIzv39CzeewCS_C8z4WGI1qyzfSOQakg7IC8v5zQReS2Ykd8YaUr7fc13gEG4i0gVkTE9fVN0XA8zu8kYAiJfAFHzAcy722T_jNC2tkJE2Es3IBOKC2MEQ\" width=\"600\" height=\"357\"></p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">Terceiro no momento de embarcar o Equipamento, devemos habilitar módulo de Pagamento</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\"><img src=\"https://lh5.googleusercontent.com/VZTBIxeL5wCyzeQ_ZakT-PI58aguCWprNHzFZR7XOI5UVaavlGuwu9RkcbPWI9kpFkZeXxsUn3EChQqbCUY2oI6otlS_cPWXSEQwsHnfQTEQDl0VwGlc28c8YOaZCdlNKMoTXPSxn7Snn3A9bw\" width=\"600\" height=\"420\"></p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">Feito isto, devemos configurar as cotas na interface de Admnistração do Payment System.</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">OPERADOR DE CAIXA (CASH DESK) - Caso tenhamos algum funcionário responsável por inserir Cota com base em Dinheiro, devemos habilitar a função \"Cash Operator\" no safeQ.</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">Acesso: <a href=\"https://ip_servidor:8443/payment-system/administration\">https://IP_SERVIDOR:8443/payment-system/administration</a></p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">INFORMAÇÕES PARA AJUDAR NA CONSTRUÇÃO DE FILTROS NA SINTAX LDAP:</p><p dir=\"ltr\"><a href=\"https://bdm.bitrix24.com.br/workgroups/group/5/wiki/DOCUMENTAR/edit/\">DOCUMENTAR</a></p></b><br><br></p>',1,'',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1573761105),(34,8,0,'','<p><b id=\"docs-internal-guid-c9c8eb62-7fff-f883-5033-df16810a7f11\"><h1 dir=\"ltr\">IBS ADVANCED (COLETA DE MEDIDORES E ALERTAS DE SERVIÇO E SUPRIMENTOS)</h1><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">Utilizamos a solução IBS Advanced para a coleta de medidores e coleta de alertas (serviço/manutenção e suprimentos)</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\"><a href=\"https://bdm.bitrix24.com.br/disk/showFile/914/?&amp;ncc=1&amp;ts=1536175630&amp;filename=TECNICO+-+Manual+de+Instala%C3%A7%C3%A3o.pdf\">DOWNLOAD MANUAL DE INSTALAÇÃO PARA TÉCNICOS</a></p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\"><a href=\"https://bdm.bitrix24.com.br/disk/showFile/890/?&amp;ncc=1&amp;ts=1536077050&amp;filename=IBSTracker+Advanced+Manual.pdf\">DOWNLOAD MANUAL ADMINISTRAÇÃO</a></p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\"><a href=\"https://bdm.bitrix24.com.br/disk/showFile/1094/?&amp;ncc=1&amp;ts=1537280360&amp;filename=IBS+Advanced+Manual+Agent.pdf\">DOWNLOAD MANUAL DE INSTALAÇÃO IBS AGENT (USB)</a></p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\"><a href=\"https://bdm.bitrix24.com.br/disk/showFile/1092/?&amp;ncc=1&amp;ts=1537280320&amp;filename=fmaagent_v4.1.1_x86_x64.zip\">DOWNLOAD IBS AGENT (USB)</a></p><p dir=\"ltr\">&nbsp;</p>Site para gerenciamento da aplicação: <a href=\"http://tracker.ibsolution.com.br/Login\">http://tracker.ibsolution.com.br/Login</a></b><br></p>',1,'12',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1573761258),(35,8,1,'','<p><b id=\"docs-internal-guid-4336d970-7fff-4a50-d2ed-52d5a68605e4\"><p dir=\"ltr\">Os instaladores para os clientes devem ser baixados nesta interface. Para cada cliente devemos cadastrar uma conta, cada conta possui um instalador.exe.&nbsp;</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">Abaixo instruções básicas para criação de uma nova conta, download do instalador e verificação de equipamentos monitorados.</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">Após fazer login, ir em NOVA CONTA</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\"><img src=\"https://lh6.googleusercontent.com/4SfeJz00YfmPPFB7ucnyMeJomDzUglrhj2nXhyAFVxNHFX04fj9azsT17B_o58syQnni6iiZht5VSmWFEu6Z_lu8nuYaHiqPJ-joarWPkez5uF7yjYJwQVBYsVUds58FaPlQB4ifKHQB494p5g\" width=\"600\" height=\"185\"></p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">Preencher as INFORMAÇÕES OBRIGATORIAS</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\"><img src=\"https://lh3.googleusercontent.com/fxxR6bm_GJ3kefSmKttiHF9hdGtBW3odG_dbKKKSgp57gp6yv4R9nE0JcoQsamKzK7V6UNC1U73sWakIHLO2nQHAOYFMzMyVXeO1fWfygym7EhJ4A4D04X5zAR8tAIPp7V9cEYk__xUKzYm_CQ\" width=\"600\" height=\"445\"></p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">Após cadastrar a nova conta, devemos fazer o DOWNLOAD DO INSTALADOR. Após instalar, podemos verificar na aba DISPOSITIVOS quais os equipamentos atualmente monitorados.</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\"><img src=\"https://lh4.googleusercontent.com/UhxXfhgjUdAAFuCXQYz3fEiV6bXLO58tX9xrmQsvdaTMfftIKO-xKmKgu5ydYAFxdCM-bTaL1fuk2FvQxPN-Gaq8hN9N2So4PoMnb7jyknQRaaM3tao6MmwkfErehYktSESMMcELloIm_qpn6A\" width=\"600\" height=\"236\"></p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\"><img src=\"https://lh6.googleusercontent.com/_QhZ0-2piIwWtvDhoDI2y5Yen39cC57YwtCUzDCH8X_xeQORTpCsetMTIQnS-VhZyzYrf132JAfP5HAtU6OyFNrXB5DmLfCjO-JVLjMUxcyFUztBfk4AtxBUVQJjw1z17PrqKg08SXkTUvADpQ\" width=\"600\" height=\"251\"></p></b><br><br></p>',1,'',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1573761277),(39,9,0,'','<p><b id=\"docs-internal-guid-64eb4b33-7fff-5345-fe1b-3b7d9d517561\"><h1 dir=\"ltr\">NDD</h1><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">A solução NDD da NBilling é uma solução de contabilização/monitoramento bem flexível no sentido de infra-estrutura.</p></b><br><br></p>',1,'13',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1573761673),(40,9,1,'','<p><b id=\"docs-internal-guid-7067fdc7-7fff-b638-8145-942d0f5ba7f7\"><p dir=\"ltr\">HOST -&gt;</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">COLECTOR -&gt;</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">AGENT -&gt;</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">CLIENT.</p><p dir=\"ltr\">&nbsp;</p><ol><li dir=\"ltr\"><p dir=\"ltr\" role=\"presentation\">Para instalarmos o Cliente embarcado em um equipamento, devemos primeiro adicionar o ip da impressora no HOST<br><br><br><br></p></li><li dir=\"ltr\"><p dir=\"ltr\" role=\"presentation\">Após isso devemos fazer o upload do arquivo .PHAR na interface web<br><br><br><br></p></li><li dir=\"ltr\"><p dir=\"ltr\" role=\"presentation\">Após enviar o arquivo, devemos configurá-lo para que se comunique com o servidor.<br></p></li></ol><br><br><p dir=\"ltr\">Melhorar documentação INFORMAÇÕES DE USB</p><p dir=\"ltr\">Contato do Pablo Ferreira novo executivo de contas:</p><p dir=\"ltr\">Telefone: (11) 9 8608-0116</p><p dir=\"ltr\">E-mail: pablo.ferreira@ndd.com.br</p><p dir=\"ltr\">Skype: pabloferreira92</p></b><br><br></p>',1,'',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1573761696),(41,9,2,NULL,'',1,'',1,NULL,1573761661),(42,9,3,NULL,'',1,'',1,NULL,1573761661),(43,9,4,NULL,'',1,'',1,NULL,1573761661),(44,10,0,'','<p><b id=\"docs-internal-guid-e4aac2d8-7fff-8845-6645-22d1bb233c7d\"><h1 dir=\"ltr\">AUTOSTORE (PROCESSAMENTO DE DOCUMENTOS)</h1><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">O AutoStore é uma solução de Processamento de Documentos. No nosso caso, utilizamos principalmente alinhada ao Ged M-Files para a geração de XML com a classificação de metadados dos documentos e processamento de OCR.</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">Em geral embarcamos a solução AutoStore em equipamentos Samsung e Xerox. No AutoStore são criados os formulários que serão preenchidos pelo Operador da Digitalização.</p></b><br><br></p>',1,'14',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1573761882),(45,10,1,'','<p><b id=\"docs-internal-guid-b27025a7-7fff-c22c-8600-0f92e0530c8e\"><p dir=\"ltr\">Exemplo básico de Configuração:</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\"><img src=\"https://lh3.googleusercontent.com/X0r4Eft29t8Jjo1_GGQj4r1Zjug28cJ9tUVBLOuMkYfHpj3w5JC8EMWOxVC3wpsKo90sm8nj1BO1aCEzL-H13Dq5riOKMrLtbatreIK1yi4NzGllZaBdRL0GkHCTJc2HSAtf3pLs\" width=\"600\" height=\"91\"></p></b><br><br></p>',1,'',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1573761898),(46,10,2,'','<p><b id=\"docs-internal-guid-f74c5974-7fff-0c88-e1a3-5e72cf2547c3\"><p dir=\"ltr\">Acessando as configurações do \"Samsung Smart UX\", podemos criar os formulários que serão embarcados no Multifuncional</p><p dir=\"ltr\"><img src=\"https://lh5.googleusercontent.com/zpewlG0GdF-m2eOTP2vzeiQo9N3kIGkmbH9WQ6Z07o2iX-qaNpRSVMs3wEoAOqpzowFvcTSSGHl7rI5UW6Ybcn5XJVr9d1IOLIzihEVEKWRMF0kKb3le4TGCFMRw4tMdKYuHcTwb\" width=\"520\" height=\"357\"></p><p dir=\"ltr\">Nas configurações dos formulários, definidos os campos, tipo do campo, obrigatoriedade</p><p dir=\"ltr\"><img src=\"https://lh3.googleusercontent.com/3bS5UJjE187YfWWc1cceYIQMUhTr-vZ2r2Xl0UXdEHvNbJ7mmr3L_v2-Zw-80i5OysvhldeulFagm_KSdS-0Ha1Xjy4yltQ7kHeYo9JgavcKugWgZRWemxkCkrFgYThse-IzGKWE\" width=\"483\" height=\"189\"></p><p dir=\"ltr\">Também configuramos as opções de OCR e XML</p><p dir=\"ltr\"><img src=\"https://lh5.googleusercontent.com/HPKx9aupXzns3UHK8hWAI0D9sNKmvCVPX2nEpi7t_HWrVQmQeDK1ZyBlYhCRysBv-tXr0UYzxTPVllkDrOmOm7wXQRztt-E97ecd7gi0m4iazqTyEMvPeZDNWbJA9moPclacI6At\" width=\"499\" height=\"156\"></p><p dir=\"ltr\">Configuração do OCR</p><p dir=\"ltr\"><img src=\"https://lh4.googleusercontent.com/YSIIS3X6NKPOhcX4A7bNrnEMKUkKINg6Ya-eIqBhmVjTxyEXcOoN7iHMDl-l2rjTfc3F8fX4-t0PWBms4z8QtynvPxzqAvgaVCcbOoOb3rbdNlOCKADNKGFLqG-Ij-RVBycloMq7\" width=\"347\" height=\"487\"></p><p dir=\"ltr\">Configuração do XML</p><p dir=\"ltr\"><img src=\"https://lh5.googleusercontent.com/FWUQ9cQmsYrRgp6MzatOPQzSznOoUrV0mGk8FZvZe0DBpS6wuiEXUQ-faXPfH5iJf2xVlrCrdY_oBrdYTkfhauCQ_cmI8aguU35cW3idQ3EPaQKeUMmO6lFmiwGSCKFX6Rop0iOM\" width=\"600\" height=\"539\"></p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">Configurações de remoção de Páginas em Branco:</p><p dir=\"ltr\"><img src=\"https://lh4.googleusercontent.com/x__51GfiecniB4Xa_tzOEPTMhOPOYBS7jjZC0pEeDyz5kkIPfjue0UbsOEQCXW2_-XwbuTUmtFEgoUDG0kUq0Fir94FQ8E177wnNKTcVaj7OkvLCjEjphHW-MKUqQZw4_uO6uCKO\" width=\"600\" height=\"344\"></p></b><br><br></p>',1,'',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1573761916),(47,10,3,'','<p><b id=\"docs-internal-guid-4b01b1ff-7fff-3368-afef-1c9418711e6c\"><p dir=\"ltr\">Menu de ações:</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\"><img src=\"https://lh4.googleusercontent.com/InulKtbxFKE-ZuP5FLLAJEiWxOFKgTYwK-211Zpe6fBDHIKXa8ek-Mz-fP00V77KE7n_uuu7XxTtgIAWPUljO7Zw6-QdJDXjDYTpE2103J5p_RPjZ4JLE7bae9tlWhQC3k-I7A7f\" width=\"536\" height=\"157\"></p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">Devemos registrar a Licença pelo Menu do AutoStore.</p><p dir=\"ltr\">Também podemos acompanhar com detalhes pelo Status Monitor</p><p dir=\"ltr\">Também é importante veriifcar se há atualizações de módulos disponíveis no Software Updates</p></b><br><br></p>',1,'',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1573761928),(48,10,4,'','<p><b id=\"docs-internal-guid-747340d9-7fff-75cf-88f5-44c5c16d8145\"><p dir=\"ltr\">DEVICE REGISTRATION SERVICE</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">Após instalação e configuração do AutoStore, precisaremos instalar o módulo DRS para embarcar a solução desenhada no Auto Store Process Design.</p><p dir=\"ltr\">Este módulo está na subpasta chamada \"DRS Installation\" dentro da pasta do AutoStore.</p><p dir=\"ltr\">Caso após a instalação, a aplicação apresente erro relacionado a \'C:\\WINDOWS\\Microsoft.NET\\Framework\\v2.0.50727\\Temporary ASP.NET Files\', devemos criar esta última pasta manualmente.</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\"><img src=\"https://lh6.googleusercontent.com/ZudcSDB0BQBsCquGts2UOXs0zHB_rC1ZSqYs3am2W_XoX6b_OMfBc0KcsadQEjuhSDsmFhvgs4arsfSvBUpLd2eSSO4vzX3xB66pgSusrqLOI8HMZXg3JCDG_VlsP2mqz0Wu4wvQ\" width=\"435\" height=\"600\"></p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">Interface do módulo DRS</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">Devemos criar um aplicativo com as configurações abaixo:</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\"><img src=\"https://lh3.googleusercontent.com/1LkDAAv5GVziNU6RAglWWanRYh7OHn6c1QskyK_1QIavAN1DgzMbym8xpDUqSvcvLx_p7l7o_bSKwSV8J7o2tiWZI5VfXyreDI6ey03uSNnMyldQUPq3gShkopbZ8WG76craWoqe\" width=\"600\" height=\"231\"></p><h2 dir=\"ltr\">&nbsp;</h2><p dir=\"ltr\">Depois, devemos criar um DISPOSITIVO e o relacionar com o APLICATIVO já criado</p><p dir=\"ltr\"><img src=\"https://lh3.googleusercontent.com/g01JCxqVNQcbsmWyb4J51qtgMUvMsKZ8P9cWzzECRZU6z4guoi4CwK4R5W062cprjZ9rY9wNM8E2R933VyRw8G3AVHlKJltJdzRFANCmJCofhrz2S3zC8VSV1XDNgVBN9k7BHkOV\" width=\"600\" height=\"228\"></p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">Após isto, devemos instalar o aplicativo e depois Configurá-lo.</p><p dir=\"ltr\"><img src=\"https://lh6.googleusercontent.com/i_LQbAMrOiwk2DQ9o8Q-OW5f7kHVb35o9hXpQRSrxMiKFwwHpOPFupg0sLx5zu93vYDNHLJNA-dCsPQ1FDPCSow-ipx81mqkMZQS2ck4KHrOT-AdrTBb45Vqs4M8507Nfj_877Sz\" width=\"600\" height=\"215\"></p></b><br><br></p>',1,'',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1573761944),(49,10,5,'','<p><b id=\"docs-internal-guid-ef50eb93-7fff-c650-e723-e172c713385e\"><p dir=\"ltr\">Exemplo de Painel embarcado</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\"><img src=\"https://lh3.googleusercontent.com/ik5bsDQNpY_-JTyOh7jQ6v9DbWyD-COgOGmT5jCRjtD3ebQWGlR2SN_z8yFtIFttwcvJDJ7LFuZCPkR6F1mB5MWBdmVlYUn9qE-h-tsZpq6SiyMRMG7Dd-Oax_EIamFKI2DZEmai\" width=\"600\" height=\"451\"></p></b><br><br></p>',1,'',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1573761961),(50,11,0,'','<p><b id=\"docs-internal-guid-d037dce5-7fff-1efc-8d31-83c5c64ffba1\"><h3 dir=\"ltr\">M-FILES</h3><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\"><a href=\"https://1drv.ms/u/s!As8xWjT95g52gQ--UoZ-CfY_STRZ\">DOWNLOAD M-FILES 2015</a></p><p dir=\"ltr\"><a href=\"https://1drv.ms/u/s!As8xWjT95g52hATk_sE9oSmmKBV4\">DOWNLOAD M-FILES 2018</a></p></b><br><br></p>',1,'15',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1573762053),(51,11,1,'','<p><b id=\"docs-internal-guid-b02874ad-7fff-7998-e243-8d375463a344\"><p dir=\"ltr\">Instruções básicas:</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">CRIAÇÃO DE NOVO TIPO DE DOCUMENTO</p><p dir=\"ltr\"><img src=\"https://lh5.googleusercontent.com/2n4pIrL4QTsyM2z0cXR-1JNGH1Ta5KHeGaAT-ixnAWJ0TUZ-tpU-3SiNq3RR1t7KXUx6D9TCF5plymevbAYAfKp03w9aIUA0jnH4MafnrCZDr59sTW7Vr6_-H1UZ3o6zuZsYT0HP\" width=\"600\" height=\"335\"></p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">CRIAÇÃO DE NOVO METADADO</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\"><img src=\"https://lh6.googleusercontent.com/3l4X-ZS2AiI_VcFlrgnXHRK9-gid1X_jXcHLcyeMRfFGu5FZB2dKfHXkA6AU_RQrGgNa_vdxlSLijlR_HD8M3HUeYl3Auv5ATkSvYEzUiD032cx6E3REnmyOIR7yTXhroomM9pu-\" width=\"600\" height=\"139\"></p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">CRIAÇÃO DE WORKFLOW</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\"><img src=\"https://lh4.googleusercontent.com/jD3MJSi_YIYZieR9wUgkSwOPHiAln85HzmY7VdtH-mTRdpyh74cqWJhEafp1F2DRG34roZJGzuls5sJ3WvXZmFtQEeK0ezFHrX2izqFwKUCj-K2eet6SSPoF8pPWUb1UvLtQey_g\" width=\"600\" height=\"263\"></p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">CRIAÇÃO DE NOVOS USUÁRIOS</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\"><img src=\"https://lh3.googleusercontent.com/oFILOZh_wJjtRbsbBP0mul5Zf2n-ZcJ2olmM5tOUtjEW94cPQvYImH8zYu5BBZal-GXP9qLCMuEXazZHmE2X_U6uiDLMcTpSn52aqfB2Qr2grGOyugUrL1DsYklVeq26QBLAaKAW\" width=\"600\" height=\"231\"></p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\"><img src=\"https://lh4.googleusercontent.com/XlpRq2RdMjkZdIp1W3uvsXvksxTIHzhL_Jr5Sun1DQeQKv76w4Xc6rz5gNrCLGRGneCZqQkK1Pp81h0yY_90Vs0qcrVfbY7mE8TOYmcJd1WEAEcGrg-hRSiZxVBmTeywLYRG3TPS\" width=\"405\" height=\"563\"></p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">CRIAÇÃO DE VISTAS DE DOCUMENTOS</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">Exemplo de vista por Produtividade (exibe todos os documentos com base no mês de criação)</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\"><img src=\"https://lh3.googleusercontent.com/FR8hpA7QZeeN1b3I2BEzUcGpOGo8zsE17jpmIXY7AApQvMNaXlcFCU-SYH5wztt0Q2TfOQNtZqMyK8VMykkrD9_x7PPXwHZ0t64y7i9BixlfGLzFzXfnahaxQv0MUJ_sDG3HVzUW\" width=\"600\" height=\"383\"></p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\">Exemplo de vista por Assunto (campo de lista de classificação do cliente)</p><p dir=\"ltr\">&nbsp;</p><p dir=\"ltr\"><img src=\"https://lh3.googleusercontent.com/U7WzgpLH6G8sdvUa8DvgNGffanbXURGhR7g62CVQ2GbjyvJpD5h7Lp23CUNQrM1lsBkLXaxW-tSU2vMqtAvhQrTDeTRbGWe2NrN4A0MZAwODSzS4adYesjYP0fKCHfRBT1duzL8c\" width=\"600\" height=\"380\"></p></b><br><br></p>',1,'',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1573762075);
