de apoio \\u00e0 aprendizagem, pode ser instalado em v\\u00e1rias plataformas que consigam executar a linguagem php tais como Unix, Linux, Windows. MAC OS. Como base de dados podem ser utilizados MySQL, PostgreSQL, Oracle, Access, Interbase ou ODBC.<\\/p><p>Seu desenvolvimento \\u00e9 de forma colaborativa por uma comunidade virtual, a qual re\\u00fane programadores, designers, administradores, professores e usu\\u00e1rios do mundo inteiro e est\\u00e1 dispon\\u00edvel em diversos idiomas.<\\/p><p>A plataforma v\\u00eam sendo utilizada n\\u00e3o s\\u00f3 como ambiente de suporte \\u00e0 Educa\\u00e7\\u00e3o a Dist\\u00e2ncia mas tamb\\u00e9m como apoio a cursos presenciais, forma\\u00e7\\u00e3o de grupos de estudo, treinamento de professores.<\\/p><p>O moodle v\\u00eam sendo usado para apoio de cursos presencias, os professores acabam substituindo em deixar material na copiadora da faculdade ou enviar arquivos para uma grande quantidade de emails de seus alunos, ele apenas tem que ter uma disciplina criada no moodle para \\u201cpendurar\\u201d l\\u00e1 os arquivos de texto, que os alunos devem ler para o acompanhamento da mat\\u00e9ria. \\u00c9 uma solu\\u00e7\\u00e3o f\\u00e1cil, que n\\u00e3o exige muito conhecimento t\\u00e9cnico do professor e nem mesmo do aluno.<\\/p><p>Se o professor desejar, o moodle tamb\\u00e9m envia um email para os alunos avisando que existe material novo no curso. Evita que o professor tenha que digitar muitos emails, desta forma ningu\\u00e9m fica com a caixa cheia de emails e arquivos, o aluno entra no curso para baixar ou ler o conte\\u00fado, assim fica mais f\\u00e1cil administrar seu tempo para estudar.<\\/p><p>Aqui um<a href=\\\"http:\\/\\/moodlelivre.files.wordpress.com\\/2008\\/09\\/como_publicar_material.pdf\\\">\\u00a0tutorial Moodle\\u00a0<\\/a>bem legal do Mackenzie que explica em detalhes como o professor deve fazer para configurar essa tarefa no Moodle.<\\/p><p>Aproveite para assinar nosso\\u00a0<a href=\\\"https:\\/\\/www.youtube.com\\/channel\\/UCbK2ONLCFLO_9_ha_nnJcog\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Canal no Youtube<\\/a>\\u00a0e se precisar de ajuda fale comigo aqui pelos coment\\u00e1rios ou atrav\\u00e9s do\\u00a0<a href=\\\"https:\\/\\/www.moodlelivre.com.br\\/kunena\\/indice\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">f\\u00f3rum do blog<\\/a>.\\u00a0<\\/p><p><strong>Saiba mais sobre o Moodle<\\/strong>, desde customiza\\u00e7\\u00e3o, inscri\\u00e7\\u00e3o de alunos, cria\\u00e7\\u00e3o de cursos \\u00e0 gamifica\\u00e7\\u00e3o!\\u00a0<br \\/>Curso Moodle para Professores e Administradores:\\u00a0<a href=\\\"http:\\/\\/www.salaead.com.br\\/\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">www.salaead.com.br<\\/a><\\/p><br \\/>\",\"pathnamehashes\":[],\"discussionid\":1,\"triggeredfrom\":\"forum_add_discussion\"}',1571957576,'web','192.168.1.101',NULL),(86,'\\mod_forum\\event\\discussion_created','mod_forum','created','discussion','forum_discussions',1,'c',2,27,70,1,2,2,NULL,0,'{\"forumid\":1}',1571957576,'web','192.168.1.101',NULL),(87,'\\mod_forum\\event\\course_module_viewed','mod_forum','viewed','course_module','forum',1,'r',2,27,70,1,2,2,NULL,0,'null',1571957576,'web','192.168.1.101',NULL),(88,'\\core\\event\\dashboard_viewed','core','viewed','dashboard',NULL,NULL,'r',0,25,30,3,3,0,3,0,'null',1571957582,'web','172.20.0.1',NULL),(89,'\\core\\event\\dashboard_viewed','core','viewed','dashboard',NULL,NULL,'r',0,25,30,3,3,0,3,0,'null',1571957584,'web','172.20.0.1',NULL),(90,'\\core\\event\\dashboard_viewed','core','viewed','dashboard',NULL,NULL,'r',0,25,30,3,3,0,3,0,'null',1571957594,'web','172.20.0.1',NULL),(91,'\\gradereport_overview\\event\\grade_report_viewed','gradereport_overview','viewed','grade_report',NULL,NULL,'r',2,2,50,1,3,1,3,0,'null',1571957603,'web','172.20.0.1',NULL),(92,'\\core\\event\\dashboard_viewed','core','viewed','dashboard',NULL,NULL,'r',0,25,30,3,3,0,3,0,'null',1571957627,'web','172.20.0.1',NULL),(93,'