INSERT INTO `mdl_notifications` VALUES (1,-10,3,'Você enviou sua tarefa para Tarefa de casa','MoodleBasico -> Tarefa -> Tarefa de casa\n---------------------------------------------------------------------\nVocê enviou uma tarefa para \'Tarefa de casa\'\n\nVocê pode ver o estado do seu envio:\n\n  https://localhost/mod/assign/view.php?id=4\n\n---------------------------------------------------------------------\n',2,'<p><font face=\"sans-serif\"><a href=\"https://localhost/course/view.php?id=2\">MoodleBasico</a> -><a href=\"https://localhost/mod/assign/index.php?id=2\">Tarefa</a> -><a href=\"https://localhost/mod/assign/view.php?id=4\">Tarefa de casa</a></font></p><hr /><font face=\"sans-serif\"><p><p>Você enviou uma tarefa em <i>Tarefa de casa</i>\'.</p>\n<p>Você pode ver aqui o status da sua <a href=\"https://localhost/mod/assign/view.php?id=4\">tarefa enviada</a>.</p></p></font><hr />','Você enviou sua tarefa para Tarefa de casa','mod_assign','assign_notification','https://localhost/mod/assign/view.php?id=4','Tarefa de casa',NULL,1571958678,'{\"cmid\":\"4\",\"instance\":\"1\",\"messagetype\":\"submissionreceipt\",\"blindmarking\":false,\"uniqueidforuser\":\"1\",\"courseid\":\"2\"}'),(2,2,3,'MoodleBasico: O que é o Moodle','MoodleBasico -> Forums -> Announcements -> O que é o Moodle \nhttp://127.0.0.1:80/mod/forum/discuss.php?d=1#p1\nO que é o Moodle\nby Admin User - Thursday, 24 October 2019, 7:52 PM\n---------------------------------------------------------------------\nO moodle é um software livre de apoio à aprendizagem, pode ser instalado\nem várias plataformas que consigam executar a linguagem php tais como\nUnix, Linux, Windows. MAC OS. Como base de dados podem ser utilizados\nMySQL, PostgreSQL, Oracle, Access, Interbase ou ODBC.\n\nSeu desenvolvimento é de forma colaborativa por uma comunidade virtual, a\nqual reúne programadores, designers, administradores, professores e\nusuários do mundo inteiro e está disponível em diversos idiomas.\n\nA plataforma vêm sendo utilizada não só como ambiente de suporte à\nEducação a Distância mas também como apoio a cursos presenciais,\nformação de grupos de estudo, treinamento de professores.\n\nO moodle vêm sendo usado para apoio de cursos presencias, os professores\nacabam substituindo em deixar material na copiadora da faculdade ou enviar\narquivos para uma grande quantidade de emails de seus alunos, ele apenas\ntem que ter uma disciplina criada no moodle para “pendurar” lá os\narquivos de texto, que os alunos devem ler para o acompanhamento da\nmatéria. É uma solução fácil, que não exige muito conhecimento\ntécnico do professor e nem mesmo do aluno.\n\nSe o professor desejar, o moodle também envia um email para os alunos\navisando que existe material novo no curso. Evita que o professor tenha que\ndigitar muitos emails, desta forma ninguém fica com a caixa cheia de\nemails e arquivos, o aluno entra no curso para baixar ou ler o conteúdo,\nassim fica mais fácil administrar seu tempo para estudar.\n\nAqui um tutorial Moodle  [1]bem legal do Mackenzie que explica em\ndetalhes como o professor deve fazer para configurar essa tarefa no Moodle.\n\nAproveite para assinar nosso Canal no Youtube [2] e se precisar de ajuda\nfale comigo aqui pelos comentários ou através do fórum do blog [3]. \n\nSAIBA MAIS SOBRE O MOODLE, desde customização, inscrição de alunos,\ncriação de cursos à gamificação! \nCurso Moodle para Professores e Administradores: www.salaead.com.br [4]\n\n\n\nLinks:\n------\n[1] http://moodlelivre.files.wordpress.com/2008/09/como_publicar_material.pdf\n[2] https://www.youtube.com/channel/UCbK2ONLCFLO_9_ha_nnJcog\n[3] https://www.moodlelivre.com.br/kunena/indice\n[4] http://www.salaead.com.br/\n\n\n\n---------------------------------------------------------------------\nChange your forum digest preferences: http://127.0.0.1:80/mod/forum/index.php?id=2',2,'<div class=\"navbar\">\n    <a target=\"_blank\" href=\"http://127.0.0.1:80/course/view.php?id=2\">MoodleBasico</a>\n    &raquo;\n    <a target=\"_blank\" href=\"http://127.0.0.1:80/mod/forum/index.php?id=2\">Forums</a>\n    &raquo;\n    <a target=\"_blank\" href=\"http://127.0.0.1:80/mod/forum/view.php?f=1\">Announcements</a>\n    &raquo;\n    <a target=\"_blank\" href=\"http://127.0.0.1:80/mod/forum/discuss.php?d=1\">O que é o Moodle</a>\n</div>\n\n<table border=\"0\" cellpadding=\"3\" cellspacing=\"0\" class=\"forumpost\">\n    <tr class=\"header\">\n        <td width=\"35\" valign=\"top\" class=\"picture left\">\n            <a href=\"http://127.0.0.1:80/user/view.php?id=2&amp;course=2\"><img src=\"http://127.0.0.1:80/theme/image.php/_s/boost/core/1571957904/u/f2\" class=\"userpicture defaultuserpic\" width=\"35\" height=\"35\" alt=\"Picture of Admin User\" title=\"Picture of Admin User\" /></a>\n        </td>\n        <td class=\"topic starter\">\n            <div class=\"subject\">\n                O que é o Moodle\n            </div>\n            <div class=\"author\">\n                by <a target=\'_blank\' href=\'http://127.0.0.1:80/user/view.php?id=2&course=2\'>Admin User</a> - Thursday, 24 October 2019, 7:52 PM\n            </div>\n        </td>\n    </tr>\n    <tr>\n        <td class=\"left side\" valign=\"top\">\n                &nbsp;\n        </td>\n        <td class=\"content\">\n            <p></p><p>O moodle é um software livre de apoio à aprendizagem, pode ser instalado em várias plataformas que consigam executar a linguagem php tais como Unix, Linux, Windows. MAC OS. Como base de dados podem ser utilizados MySQL, PostgreSQL, Oracle, Access, Interbase ou ODBC.</p><p>Seu desenvolvimento é de forma colaborativa por uma comunidade virtual, a qual reúne programadores, designers, administradores, professores e usuários do mundo inteiro e está disponível em diversos idiomas.</p><p>A plataforma vêm sendo utilizada não só como ambiente de suporte à Educação a Distância mas também como apoio a cursos presenciais, formação de grupos de estudo, treinamento de professores.</p><p>O moodle vêm sendo usado para apoio de cursos presencias, os professores acabam substituindo em deixar material na copiadora da faculdade ou enviar arquivos para uma grande quantidade de emails de seus alunos, ele apenas tem que ter uma disciplina criada no moodle para “pendurar” lá os arquivos de texto, que os alunos devem ler para o acompanhamento da matéria. É uma solução fácil, que não exige muito conhecimento técnico do professor e nem mesmo do aluno.</p><p>Se o professor desejar, o moodle também envia um email para os alunos avisando que existe material novo no curso. Evita que o professor tenha que digitar muitos emails, desta forma ninguém fica com a caixa cheia de emails e arquivos, o aluno entra no curso para baixar ou ler o conteúdo, assim fica mais fácil administrar seu tempo para estudar.</p><p>Aqui um<a href=\"http://moodlelivre.files.wordpress.com/2008/09/como_publicar_material.pdf\"> tutorial Moodle </a>bem legal do Mackenzie que explica em detalhes como o professor deve fazer para configurar essa tarefa no Moodle.</p><p>Aproveite para assinar nosso <a href=\"https://www.youtube.com/channel/UCbK2ONLCFLO_9_ha_nnJcog\" target=\"_blank\" rel=\"noreferrer noopener\">Canal no Youtube</a> e se precisar de ajuda fale comigo aqui pelos comentários ou através do <a href=\"https://www.moodlelivre.com.br/kunena/indice\" target=\"_blank\" rel=\"noreferrer noopener\">fórum do blog</a>. </p><p><strong>Saiba mais sobre o Moodle</strong>, desde customização, inscrição de alunos, criação de cursos à gamificação! <br />Curso Moodle para Professores e Administradores: <a href=\"http://www.salaead.com.br/\" target=\"_blank\" rel=\"noreferrer noopener\">www.salaead.com.br</a></p><br />\n\n            <div class=\"commands\">\n            </div>\n\n            <div class=\"link\">\n                <a target=\"_blank\" href=\"http://127.0.0.1:80/mod/forum/discuss.php?d=1#p1\">\n                    See this post in context\n                </a>\n            </div>\n        </td>\n    </tr>\n</table>\n\n<hr />\n<div class=\"mdl-align unsubscribelink\">\n    <a href=\"http://127.0.0.1:80/mod/forum/index.php?id=2\">Change your forum digest preferences</a>\n</div>','Admin User posted in MoodleBasico: Announcements: O que é o Moodle','mod_forum','posts','http://127.0.0.1:80/mod/forum/discuss.php?d=1#p1','O que é o Moodle',NULL,1571959382,'{\"cmid\":\"1\",\"instance\":\"1\",\"discussionid\":\"1\",\"postid\":\"1\",\"notificationiconurl\":\"http:\\/\\/127.0.0.1:80\\/theme\\/image.php\\/_s\\/boost\\/core\\/1571957904\\/u\\/f2\",\"actionbuttons\":{\"reply\":\"Reply\"},\"courseid\":\"2\"}'),(3,2,2,'MoodleBasico: O que é o Moodle','MoodleBasico -> Fóruns -> Announcements -> O que é o Moodle \nhttp://127.0.0.1:80/mod/forum/discuss.php?d=1#p1\nO que é o Moodle\npor Admin User - Thursday, 24 Oct 2019, 19:52\n---------------------------------------------------------------------\nO moodle é um software livre de apoio à aprendizagem, pode ser instalado\nem várias plataformas que consigam executar a linguagem php tais como\nUnix, Linux, Windows. MAC OS. Como base de dados podem ser utilizados\nMySQL, PostgreSQL, Oracle, Access, Interbase ou ODBC.\n\nSeu desenvolvimento é de forma colaborativa por uma comunidade virtual, a\nqual reúne programadores, designers, administradores, professores e\nusuários do mundo inteiro e está disponível em diversos idiomas.\n\nA plataforma vêm sendo utilizada não só como ambiente de suporte à\nEducação a Distância mas também como apoio a cursos presenciais,\nformação de grupos de estudo, treinamento de professores.\n\nO moodle vêm sendo usado para apoio de cursos presencias, os professores\nacabam substituindo em deixar material na copiadora da faculdade ou enviar\narquivos para uma grande quantidade de emails de seus alunos, ele apenas\ntem que ter uma disciplina criada no moodle para “pendurar” lá os\narquivos de texto, que os alunos devem ler para o acompanhamento da\nmatéria. É uma solução fácil, que não exige muito conhecimento\ntécnico do professor e nem mesmo do aluno.\n\nSe o professor desejar, o moodle também envia um email para os alunos\navisando que existe material novo no curso. Evita que o professor tenha que\ndigitar muitos emails, desta forma ninguém fica com a caixa cheia de\nemails e arquivos, o aluno entra no curso para baixar ou ler o conteúdo,\nassim fica mais fácil administrar seu tempo para estudar.\n\nAqui um tutorial Moodle  [1]bem legal do Mackenzie que explica em\ndetalhes como o professor deve fazer para configurar essa tarefa no Moodle.\n\nAproveite para assinar nosso Canal no Youtube [2] e se precisar de ajuda\nfale comigo aqui pelos comentários ou através do fórum do blog [3]. \n\nSAIBA MAIS SOBRE O MOODLE, desde customização, inscrição de alunos,\ncriação de cursos à gamificação! \nCurso Moodle para Professores e Administradores: www.salaead.com.br [4]\n\n\n\nLinks:\n------\n[1] http://moodlelivre.files.wordpress.com/2008/09/como_publicar_material.pdf\n[2] https://www.youtube.com/channel/UCbK2ONLCFLO_9_ha_nnJcog\n[3] https://www.moodlelivre.com.br/kunena/indice\n[4] http://www.salaead.com.br/\n\n\n\n---------------------------------------------------------------------\nEsta é uma cópia da mensagem postada no MoodleBasico.\n\nPara respondê-la clique neste link: http://127.0.0.1:80/mod/forum/post.php?reply=1\nAlterar suas configurações de compilação dos fóruns: http://127.0.0.1:80/mod/forum/index.php?id=2',2,'<div class=\"navbar\">\n    <a target=\"_blank\" href=\"http://127.0.0.1:80/course/view.php?id=2\">MoodleBasico</a>\n    &raquo;\n    <a target=\"_blank\" href=\"http://127.0.0.1:80/mod/forum/index.php?id=2\">Fóruns</a>\n    &raquo;\n    <a target=\"_blank\" href=\"http://127.0.0.1:80/mod/forum/view.php?f=1\">Announcements</a>\n    &raquo;\n    <a target=\"_blank\" href=\"http://127.0.0.1:80/mod/forum/discuss.php?d=1\">O que é o Moodle</a>\n</div>\n\n<table border=\"0\" cellpadding=\"3\" cellspacing=\"0\" class=\"forumpost\">\n    <tr class=\"header\">\n        <td width=\"35\" valign=\"top\" class=\"picture left\">\n            <a href=\"http://127.0.0.1:80/user/view.php?id=2&amp;course=2\"><img src=\"http://127.0.0.1:80/theme/image.php/_s/boost/core/1571957904/u/f2\" class=\"userpicture defaultuserpic\" width=\"35\" height=\"35\" alt=\"Imagem de Admin User\" title=\"Imagem de Admin User\" /></a>\n        </td>\n        <td class=\"topic starter\">\n            <div class=\"subject\">\n                O que é o Moodle\n            </div>\n            <div class=\"author\">\n                por <a target=\'_blank\' href=\'http://127.0.0.1:80/user/view.php?id=2&course=2\'>Admin User</a> - Thursday, 24 Oct 2019, 19:52\n            </div>\n        </td>\n    </tr>\n    <tr>\n        <td class=\"left side\" valign=\"top\">\n                &nbsp;\n        </td>\n        <td class=\"content\">\n            <p></p><p>O moodle é um software livre de apoio à aprendizagem, pode ser instalado em várias plataformas que consigam executar a linguagem php tais como Unix, Linux, Windows. MAC OS. Como base de dados podem ser utilizados MySQL, PostgreSQL, Oracle, Access, Interbase ou ODBC.</p><p>Seu desenvolvimento é de forma colaborativa por uma comunidade virtual, a qual reúne programadores, designers, administradores, professores e usuários do mundo inteiro e está disponível em diversos idiomas.</p><p>A plataforma vêm sendo utilizada não só como ambiente de suporte à Educação a Distância mas também como apoio a cursos presenciais, formação de grupos de estudo, treinamento de professores.</p><p>O moodle vêm sendo usado para apoio de cursos presencias, os professores acabam substituindo em deixar material na copiadora da faculdade ou enviar arquivos para uma grande quantidade de emails de seus alunos, ele apenas tem que ter uma disciplina criada no moodle para “pendurar” lá os arquivos de texto, que os alunos devem ler para o acompanhamento da matéria. É uma solução fácil, que não exige muito conhecimento técnico do professor e nem mesmo do aluno.</p><p>Se o professor desejar, o moodle também envia um email para os alunos avisando que existe material novo no curso. Evita que o professor tenha que digitar muitos emails, desta forma ninguém fica com a caixa cheia de emails e arquivos, o aluno entra no curso para baixar ou ler o conteúdo, assim fica mais fácil administrar seu tempo para estudar.</p><p>Aqui um<a href=\"http://moodlelivre.files.wordpress.com/2008/09/como_publicar_material.pdf\"> tutorial Moodle </a>bem legal do Mackenzie que explica em detalhes como o professor deve fazer para configurar essa tarefa no Moodle.</p><p>Aproveite para assinar nosso <a href=\"https://www.youtube.com/channel/UCbK2ONLCFLO_9_ha_nnJcog\" target=\"_blank\" rel=\"noreferrer noopener\">Canal no Youtube</a> e se precisar de ajuda fale comigo aqui pelos comentários ou através do <a href=\"https://www.moodlelivre.com.br/kunena/indice\" target=\"_blank\" rel=\"noreferrer noopener\">fórum do blog</a>. </p><p><strong>Saiba mais sobre o Moodle</strong>, desde customização, inscrição de alunos, criação de cursos à gamificação! <br />Curso Moodle para Professores e Administradores: <a href=\"http://www.salaead.com.br/\" target=\"_blank\" rel=\"noreferrer noopener\">www.salaead.com.br</a></p><br />\n\n            <div class=\"commands\">\n                    <a target=\"_blank\" href=\"http://127.0.0.1:80/mod/forum/post.php?reply=1\">\n                        Responder\n                    </a>\n            </div>\n\n            <div class=\"link\">\n                <a target=\"_blank\" href=\"http://127.0.0.1:80/mod/forum/discuss.php?d=1#p1\">\n                    Veja esta mensagem em seu contexto\n                </a>\n            </div>\n        </td>\n    </tr>\n</table>\n\n<hr />\n<div class=\"mdl-align unsubscribelink\">\n    <a href=\"http://127.0.0.1:80/mod/forum/index.php?id=2\">Alterar suas opções de resumo</a>\n</div>','Admin User enviou mensagem em MoodleBasico: Announcements: O que é o Moodle','mod_forum','posts','http://127.0.0.1:80/mod/forum/discuss.php?d=1#p1','O que é o Moodle',NULL,1571959382,'{\"cmid\":\"1\",\"instance\":\"1\",\"discussionid\":\"1\",\"postid\":\"1\",\"notificationiconurl\":\"http:\\/\\/127.0.0.1:80\\/theme\\/image.php\\/_s\\/boost\\/core\\/1571957904\\/u\\/f2\",\"actionbuttons\":{\"reply\":\"Reply\"},\"courseid\":\"2\"}'),(4,2,2,'Moodle updates are available (http://127.0.0.1:80)','Update notifications\n\nThere is a newer Moodle version available!\nMoodle 3.8 (Build: 20191118) Version 2019111800 (Stable version)\n\nSee http://127.0.0.1:80/admin/index.php for more details\n\nIt is strongly recommended that you update your site to the latest version to obtain all recent security and bug fixes.\n\nYour Moodle site http://127.0.0.1:80 is configured to automatically check for available updates. You are receiving this message as the administrator of the site. You can disable automatic checks for available updates in Site administration / Server / Update notifications or customise the delivery of this message via your preferences page.\n',2,'<h1>Update notifications</h1>\n<h2>There is a newer Moodle version available!</h2>\n<ul>\n<li><strong>Moodle 3.8 (Build: 20191118)</strong> Version 2019111800 (Stable version)</li>\n</ul>\n<p>See <a href=\"http://127.0.0.1:80/admin/index.php\">http://127.0.0.1:80/admin/index.php</a> for more details</p>\n<p>It is strongly recommended that you update your site to the latest version to obtain all recent security and bug fixes.</p>\n<footer><p style=\"font-size:smaller; color:#333;\">Your Moodle site <a href=\"http://127.0.0.1:80\">http://127.0.0.1:80</a> is configured to automatically check for available updates. You are receiving this message as the administrator of the site. You can disable automatic checks for available updates in Site administration / Server / Update notifications or customise the delivery of this message via your preferences page.</p></footer>','Update notifications','moodle','availableupdate',NULL,NULL,NULL,1574091366,NULL);
